import { createWebHistory, createRouter } from "vue-router";
import Login from "./pages/LoginPage"
import SignUp from './pages/SignUp'
import Main from './pages/MainPage'
import C1M1 from "./pages/category1/Menu1Page"
// import Login from "./pages/LoginPage.vue";

const routes = [
    {
        path: "/login",
        component: Login,
        name:'login'
    },
    {
        path: "/signup",
        component: SignUp,
        name:'singup',
    },
    {
        path: "/home",
        component: Main,
        name:"home"
    },
    {
        path:"/category1",
        redirect:"/category1/menu1",
        name:'category1',
        children:[
            {
                path:'menu1',
                name:'menu1',
                component:C1M1,
            }
        ]
    },
    {
        path:"/category2/",
        component:Main,
        name:'category2',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:"/category3/",
        component:Main,
        name:'category3',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:"/category4/",
        component:Main,
        name:'category4',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:"/category5/",
        component:Main,
        name:'category5',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:'/', redirect:'/login'
    }

]
    

const router = createRouter({
    history:createWebHistory(),
    routes
});

export default router
